// Hint
// Given two strings s and t of lengths m and n respectively, return the minimum window
// substring
//  of s such that every character in t (including duplicates) is included in the window. If there is no such substring, return the empty string "".

// The testcases will be generated such that the answer is unique.

// Example 1:

// Input: s = "ADOBECODEBANC", t = "ABC"
// Output: "BANC"
// Explanation: The minimum window substring "BANC" includes 'A', 'B', and 'C' from string t.
// Example 2:

// Input: s = "a", t = "a"
// Output: "a"
// Explanation: The entire string s is the minimum window.
// Example 3:

// Input: s = "a", t = "aa"
// Output: ""
// Explanation: Both 'a's from t must be included in the window.
// Since the largest window of s only has one 'a', return empty string.

// Constraints:

// m == s.length
// n == t.length
// 1 <= m, n <= 105
// s and t consist of uppercase and lowercase English letters.

// Follow up: Could you find an algorithm that runs in O(m + n) time?

/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function (s, t) {
  let l1 = s.length;
  let l2 = t.length;
  if (l1 < l2) return "";
  let firstMap = new Map();
  for (let letter of t) {
    let value = firstMap.get(letter);
    value = value ? value + 1 : 1;
    firstMap.set(letter, value);
  }
console.log("ar=>",firstMap)
  function compareMaps(one, second) {
    if (one.size != second.size) return false;
    for (let [key, value] of one) {
      if (!second.has(key) || value > second.get(key)) return false;
    }
    return true;
  }

  let result = "";
  for (let i = 0; i < l1; i++) {
    let secondMap = new Map();
    let str = "";

    for (let j = i; j < l1; j++) {
      let key = s[j];
      str += key;

      if (firstMap.has(key)) {
        let value = secondMap.get(key);
        value = value ? value + 1 : 1;
        secondMap.set(key, value);
        if (compareMaps(firstMap, secondMap)) {
          if (result.length == 0) result = str;
          else if (result.length > str.length) result = str;
          break;
        }
      }
    }
  }
  return result;
};

